    var keys = Object.keys(orders);
    console.log(keys);
    for (var i = 0; i < keys.length; i++) {
      var k = keys[i];
      var firstName = orders[k].firstName;
      var items = orders[k].items;
      <Order
        firstName={firstName}
        items={items}
      />
    }
    console.log(firstName, items);
  }

  function errData(err) {
    console.log('Error!');
    console.log(err);
  }

  const ret = () => {
    return <Text>Siemano</Text>
  }

  return (
    <View>
      {dtb()}
    </View>
  )
}

export default App

